import { useState, useEffect } from "react";

function useStats() {
    const [stats, setStats] = useState();
    useEffect(() => {
        console.log("Fetching Data");
        async function fetchData() {
            const data = await fetch(
                "https://covid19.mathdro.id/api"
            ).then(data => data.json());
        }
        fetchData();
    }, []);
}

function Stats() {
    return (
        <div>
            <p>Stats: </p>
        </div>
    );
}

export default function IndexPage() {
    return (
        <div>
            <Stats></Stats>
        </div>
    );
}
